import styles from "./Quote.module.scss";

export default function Quote({ slice }) {
	console.log(slice);
	return (
		<section className={styles.section}>
			<blockquote className={styles.quote}>{slice.primary.quote}</blockquote>
			<cite className={styles.author}>{slice.primary.author}</cite>
		</section>
	);
}
